import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      changeWikiSearchTerms:''
    }
  }
  changeWikiSearchTerms = (e) => {
    this.setState ({
      changeWikiSearchTerms:e.target.value
    });
  }


  render(){
  return (
    <div className="App">
      <h1>Wiki Search Hacker</h1>
      <form action="">
        <input type= "text" value ="" onChange={this.changeWikiSearchTerms} placeholder='search your Wiki Today'/>
        <button type= "submit" >Search</button>
      </form>

    </div>
  );
}
}

export default App;
